import Card from "./Card";
import database from "../data_storage/database";

const Projects = () => {
  const makeCard = () => {
    const keys = Object.keys(database);
    const values = Object.values(database);
    const entries = Object.entries(database); // Return array of key-value pairs

    let arr = [];
    keys.forEach(key => {
      arr.push(database[key]);
    });

    console.log(arr);
    return keys.map(item => (
      <Card
        id={item}
        key={item}
        quote={values.quote}
        description={values.description}
      />
    ));
  };

  return (
    <section className="main">
      <div>
        <h1>Selected Projects</h1>
      </div>
      <ul>{makeCard()}</ul>
      <style jsx>
        {`
          .main {
            display: flex;
            flex-direction: column;
            margin: 0 120px;
            text-align: center;
          }
          h1 {
            font-size: 45px;
            margin-bottom: 50px;
          }
        `}
      </style>
    </section>
  );
};

export default Projects;
